<script>
	"use strict";

	function calc() {
		document.getElementById("result").innerHTML = getResult();
	}

	function getResult() {
		const data = input.split("\n\n").map(block => block.split("\n").map(line => line.split("")));

		let blocks = [];

		for (let i = 0; i < data.length; ++i) {
			blocks.push([]);

			for (let y = 0; y < data[i].length; ++y) {
				for (let x = 0; x < data[i][y].length; ++x) {
					if (data[i][y][x] == "#") {
						blocks[blocks.length - 1].push([y, x].join(","));
					}
				}
			}
		}

		let part1 = 0;

		for (let i = 0; i < blocks.length - 1; ++i) {
			for (let j = i + 1; j < blocks.length; ++j) {
				if (blocks[i].every(e => blocks[j].indexOf(e) < 0)) {
					++part1;
				}
			}
		}

		return part1;
	}
